// SPDX-License-Identifier: MIT
pragma solidity ^0.8.0;
pragma experimental ABIEncoderV2;
import "./models/TipoEnergia.sol";
import "./models/InfoContrato.sol";
import "./models/TipoEnergiaFactory.sol";
import "./Generador.sol";
import "./Cliente.sol";
import "./models/Agente.sol";
import "./libraries/Validations.sol";

contract Comercializador is Agente {
    uint256 public contadorEmisiones = 0;
    //Variable que se encarga de guardar las direccions de los contratos del comercializador
    InfoContrato[] private clientesComercializador;

    //Variable que se encarga de guardar las direccions de los contratos del comercializador segun el owner
    mapping(string => mapping(address => TipoEnergia)) energiasClienteComercializador;
    TipoEnergiaFactory private factoryEnergia;
    TipoComercio public tipoComercio;

    mapping(uint256 => InfoEmisionCompra) private emisionCompra;
    mapping(uint256 => InfoEmisionCompra) private compra;
    event EmisionDeCompra (InfoEmisionCompra);

    constructor(InfoContrato memory _infoContrato, address _reguladorMercado) {
        reguladorMercado = _reguladorMercado;
        infoContrato = InfoContrato(
            address(this),
            _infoContrato.owner,
            _infoContrato.nit,
            _infoContrato.empresa,
            _infoContrato.contacto,
            _infoContrato.telefono,
            _infoContrato.correo,
            _infoContrato.departamento,
            _infoContrato.ciudad,
            _infoContrato.direccion,
            nullAddress,
            _infoContrato.tipoComercio
        );
        tipoComercio = TipoComercio(_infoContrato.tipoComercio);
        factoryEnergia = new TipoEnergiaFactory();
    }

    /**
    Funcion que permite la compra de energia por parte del cliente a traves de un contrato de comercializador, solo la pueden ejecutar los contratos de comercializador del tipo cliente
     */
    function ComprarEnergia(
        address _dirContrato,
        address _ownerCliente,
        uint256 _cantidadEnergia,
        string memory nombreTipoEnergia,
        uint256 index
    ) public authorize(msg.sender) onlyCliente {
        require(
            Validations.aproveCreation(_ownerCliente, clientesComercializador),
            "El cliente no es un cliente de este contrato"
        );
        Generador(_dirContrato).ComprarEnergia(
            _cantidadEnergia,
            nombreTipoEnergia,
            _ownerCliente
        );
        if (
            address(
                energiasClienteComercializador[nombreTipoEnergia][_ownerCliente]
            ) == nullAddress
        ) {
            energiasClienteComercializador[nombreTipoEnergia][
                _ownerCliente
            ] = factoryEnergia.generarNuevaEnergia(
                nombreTipoEnergia,
                _cantidadEnergia
            );
        } else {
            energiasClienteComercializador[nombreTipoEnergia][_ownerCliente]
                .addCantidadEnergia(_cantidadEnergia);
        }
        setInfoCompras(index);
    }

    function setInfoEmisionesDeCompra(
        InfoContrato memory _infoContrato,
        string memory _tipoEnergia,
        uint256 _cantidadEnergia
    ) public onlyCliente {
        InfoEmisionCompra memory infoEmisionCompra = InfoEmisionCompra(
            _infoContrato.dirContrato,
            _infoContrato.empresa,
            _tipoEnergia,
            _cantidadEnergia,
            EstadoCompra.pendiente,
            block.timestamp,
            0
        );
        emisionCompra[contadorEmisiones] = infoEmisionCompra;
        emit EmisionDeCompra(infoEmisionCompra);
        contadorEmisiones++;
    }

    function setInfoCompras(uint256 index) private authorize(msg.sender) {
        compra[index].estado = EstadoCompra.aprobada;
        compra[index].fechaAprobacion = block.timestamp;
    }

    function getInfoEmisionesDeCompra(uint index) public view returns (InfoEmisionCompra memory) {
        return emisionCompra[index];
    }
    /**
     Funcion que permite la venta de energia por parte del generador a traves de un contrato de comercializador, solo la pueden ejecutar los contratos de comercializador del tipo generador
     */
    function VentaEnergia(
        address _dirContrato,
        uint256 _cantidadEnergia,
        string memory nombreTipoEnergia
    ) public {}

    function getEnergiaDisponible(
        string memory _nombreTipoEnergia,
        address _cliente
    ) public view returns (uint256) {
        return
            energiasClienteComercializador[_nombreTipoEnergia][_cliente]
                .getCantidadEnergia();
    }

    function getTipoContrato() public view returns (uint256) {
        return uint256(tipoComercio);
    }

    function setClientesComercializador(InfoContrato memory _infoContrato)
        public
    {
        clientesComercializador.push(_infoContrato);
    }

    function getClientesComercializador()
        public
        view
        returns (InfoContrato[] memory)
    {
        return clientesComercializador;
    }

    modifier onlyCliente() {
        require(
            tipoComercio == TipoComercio.Cliente,
            "Solo los contratos de cliente pueden ejecutar esta funcion"
        );
        _;
    }
}
